import { Box } from 'grommet';

export default function TaskBoard() {
  return (
		<Box direction="row">
			<Box>
				To Do
			</Box>
			<Box>
				In Progress
			</Box>
			<Box>
				Done
			</Box>
		</Box>
  );
}
